def shot(img, dt_boxes,name):#应用于predict_det.py中,通过dt_boxes中获得的四个坐标点,裁剪出图像
    #dt_boxes = np_list_int(dt_boxes)
    boxes_len = len(dt_boxes)
    num = 0
    while 1:
        if (num < boxes_len):
            box = dt_boxes[num]
            tl = box[0]
            tr = box[1]
            br = box[2]
            bl = box[3]
            crop = img[int(tr):int(bl), int(tl):int(br) ]
            cv2.imwrite(os.getcwd()+"/"+"/tmp/" + name, crop)

            num = num + 1
        else:
            break



def getAllImgs(path):
    files=[]
    for iterImg in os.listdir(file_path):
        suffix= os.path.splitext(iterImg)[-1]
        if ".png"==suffix.lower():
            files.append(iterImg)
    return files


